import datetime
from enum import Enum
from typing import List, Dict, Optional

class SubmissionStatus(Enum):
    DRAFT = "draft"
    PUBLISHED = "published"
    PENDING = "pending"

class ValidationRuleStatus(Enum):
    ENABLED = "enabled"
    DISABLED = "disabled"

class LogLevel(Enum):
    INFO = "info"
    WARNING = "warning"
    ERROR = "error"

class Submission:
    def __init__(self, submission_id: str, user_id: str, data: Dict):
        self.submission_id = submission_id
        self.user_id = user_id
        self.data = data
        self.status = SubmissionStatus.DRAFT
        self.created_at = datetime.datetime.now()
        self.updated_at = self.created_at

    def update_status(self, new_status: SubmissionStatus) -> None:
        self.status = new_status
        self.updated_at = datetime.datetime.now()

    def get_details(self) -> Dict:
        return {
            "submission_id": self.submission_id,
            "user_id": self.user_id,
            "data": self.data,
            "status": self.status.value,
            "created_at": self.created_at,
            "updated_at": self.updated_at
        }

class UIComponent:
    def __init__(self, component_id: str, name: str, design: Dict):
        self.component_id = component_id
        self.name = name
        self.design = design
        self.versions = [design]
        self.created_at = datetime.datetime.now()
        self.updated_at = self.created_at

    def update_design(self, new_design: Dict) -> None:
        self.design = new_design
        self.versions.append(new_design)
        self.updated_at = datetime.datetime.now()

    def get_details(self) -> Dict:
        return {
            "component_id": self.component_id,
            "name": self.name,
            "current_design": self.design,
            "versions": self.versions,
            "created_at": self.created_at,
            "updated_at": self.updated_at
        }

class ValidationRule:
    def __init__(self, rule_id: str, name: str, condition: str):
        self.rule_id = rule_id
        self.name = name
        self.condition = condition
        self.status = ValidationRuleStatus.ENABLED
        self.created_at = datetime.datetime.now()
        self.updated_at = self.created_at

    def toggle_status(self) -> None:
        if self.status == ValidationRuleStatus.ENABLED:
            self.status = ValidationRuleStatus.DISABLED
        else:
            self.status = ValidationRuleStatus.ENABLED
        self.updated_at = datetime.datetime.now()

    def get_details(self) -> Dict:
        return {
            "rule_id": self.rule_id,
            "name": self.name,
            "condition": self.condition,
            "status": self.status.value,
            "created_at": self.created_at,
            "updated_at": self.updated_at
        }

class Logger:
    def __init__(self):
        self.logs = []

    def log_event(self, level: LogLevel, message: str, source: str) -> None:
        log_entry = {
            "timestamp": datetime.datetime.now(),
            "level": level.value,
            "message": message,
            "source": source
        }
        self.logs.append(log_entry)

    def get_logs(self, level: Optional[LogLevel] = None, source: Optional[str] = None) -> List[Dict]:
        filtered_logs = self.logs
        if level:
            filtered_logs = [log for log in filtered_logs if log["level"] == level.value]
        if source:
            filtered_logs = [log for log in filtered_logs if log["source"] == source]
        return filtered_logs

class SubmissionManager:
    def __init__(self):
        self.submissions: Dict[str, Submission] = {}
        self.logger = Logger()

    def create_submission(self, user_id: str, data: Dict) -> str:
        submission_id = f"sub_{datetime.datetime.now().timestamp()}"
        self.submissions[submission_id] = Submission(submission_id, user_id, data)
        self.logger.log_event(LogLevel.INFO, f"Created submission {submission_id}", "SubmissionManager")
        return submission_id

    def update_submission_status(self, submission_id: str, new_status: SubmissionStatus) -> bool:
        if submission_id not in self.submissions:
            self.logger.log_event(LogLevel.WARNING, f"Submission {submission_id} not found", "SubmissionManager")
            return False
        self.submissions[submission_id].update_status(new_status)
        self.logger.log_event(LogLevel.INFO, f"Updated submission {submission_id} status to {new_status.value}", "SubmissionManager")
        return True

    def get_submission_details(self, submission_id: str) -> Optional[Dict]:
        if submission_id not in self.submissions:
            self.logger.log_event(LogLevel.WARNING, f"Submission {submission_id} not found", "SubmissionManager")
            return None
        return self.submissions[submission_id].get_details()

class UIManager:
    def __init__(self):
        self.components: Dict[str, UIComponent] = {}
        self.logger = Logger()

    def add_component(self, name: str, design: Dict) -> str:
        component_id = f"comp_{datetime.datetime.now().timestamp()}"
        self.components[component_id] = UIComponent(component_id, name, design)
        self.logger.log_event(LogLevel.INFO, f"Added UI component {component_id}", "UIManager")
        return component_id

    def update_component_design(self, component_id: str, new_design: Dict) -> bool:
        if component_id not in self.components:
            self.logger.log_event(LogLevel.WARNING, f"Component {component_id} not found", "UIManager")
            return False
        self.components[component_id].update_design(new_design)
        self.logger.log_event(LogLevel.INFO, f"Updated design for component {component_id}", "UIManager")
        return True

    def get_component_details(self, component_id: str) -> Optional[Dict]:
        if component_id not in self.components:
            self.logger.log_event(LogLevel.WARNING, f"Component {component_id} not found", "UIManager")
            return None
        return self.components[component_id].get_details()

class ValidationManager:
    def __init__(self):
        self.rules: Dict[str, ValidationRule] = {}
        self.logger = Logger()

    def add_rule(self, name: str, condition: str) -> str:
        rule_id = f"rule_{datetime.datetime.now().timestamp()}"
        self.rules[rule_id] = ValidationRule(rule_id, name, condition)
        self.logger.log_event(LogLevel.INFO, f"Added validation rule {rule_id}", "ValidationManager")
        return rule_id

    def toggle_rule_status(self, rule_id: str) -> bool:
        if rule_id not in self.rules:
            self.logger.log_event(LogLevel.WARNING, f"Rule {rule_id} not found", "ValidationManager")
            return False
        self.rules[rule_id].toggle_status()
        self.logger.log_event(LogLevel.INFO, f"Toggled status for rule {rule_id}", "ValidationManager")
        return True

    def get_rule_details(self, rule_id: str) -> Optional[Dict]:
        if rule_id not in self.rules:
            self.logger.log_event(LogLevel.WARNING, f"Rule {rule_id} not found", "ValidationManager")
            return None
        return self.rules[rule_id].get_details()
